import React from 'react'
import '../styles/Hero.css';

const Hero = () => {
    return (
        <div>
            <div className='hero--section'>
                <div className='hero--wrapper'>
                    <h1>Hero</h1>
                </div>
            </div>
        </div>
    )
}

export default Hero
